function Router() {
	const { currentProject, projects, isLoading } = useProject();

	// Wait until projects are loaded
	if (isLoading) {
		return (
			<div className="flex items-center justify-center h-full">
				<div className="text-center">
					<div className="animate-spin rounded-full h-8 w-8 border-b-2 border-primary mx-auto mb-4"></div>
					<p className="text-muted-foreground">Loading projects...</p>
				</div>
			</div>
		);
	}

	// Show onboarding if no projects exist
	if (!isLoading && projects.length === 0) {
		return (
			<div className="flex items-center justify-center h-full">
				<div className="text-center max-w-md px-4">
					<h2 className="text-2xl font-semibold mb-2">
						Welcome to AI Lead Processing CRM
					</h2>
					<p className="text-muted-foreground mb-6">
						You don't have any projects yet. Create your first project to get
						started.
					</p>
					<p className="text-sm text-muted-foreground">
						Please contact your administrator to create a project for you.
					</p>
				</div>
			</div>
		);
	}

	// Wait for a project to be selected
	if (!currentProject) {
		return (
			<div className="flex items-center justify-center h-full">
				<div className="text-center">
					<div className="animate-spin rounded-full h-8 w-8 border-b-2 border-primary mx-auto mb-4"></div>
					<p className="text-muted-foreground">Selecting project...</p>
				</div>
			</div>
		);
	}

	return (
		<Switch>
			<Route path="/" component={Dashboard} />
			<Route path="/conversations" component={Conversations} />
			<Route path="/conversations/:id" component={ConversationDetail} />
			<Route path="/search" component={SearchPage} />
			<Route path="/contacts" component={Contacts} />
			<Route path="/users">
				{() => {
					window.location.href = "/contacts";
					return null;
				}}
			</Route>
			<Route path="/receipts" component={Receipts} />
			<Route path="/media" component={MediaLibrary} />
			<Route path="/broadcasts" component={Broadcasts} />
			<Route path="/robots" component={Robots} />
			<Route path="/pipelines" component={Pipelines} />
			<Route path="/reports" component={Reports} />
			<Route path="/analytics" component={Analytics} />
			<Route path="/segments" component={Segments} />
			<Route path="/settings" component={Settings} />
			<Route path="/automation" component={AutomationSettings} />
			<Route path="/training" component={Training} />
			<Route path="/prompts" component={Prompts} />
			<Route path="/fine-tuning" component={FineTuning} />
			<Route path="/knowledge" component={Knowledge} />
			<Route path="/templates" component={Templates} />
			<Route path="/help" component={HelpCenter} />
			<Route component={NotFound} />
		</Switch>
	);
}

