export default function FineTuning() {
	const { projectId } = useProjectQuery();
	const { toast } = useToast();
	const [isStarting, setIsStarting] = useState(false);
	const [showSettings, setShowSettings] = useState(false);
	const [autoEnabled, setAutoEnabled] = useState(false);
	const [threshold, setThreshold] = useState(100);

	// Get AI settings (to get ID for updates)
	const { data: aiSettings, isLoading: settingsLoading } = useQuery<
		AiSetting[]
	>({
		queryKey: [`/api/settings/ai?projectId=${projectId}`],
		enabled: !!projectId,
	});

	// Get active AI setting
	const activeSetting = aiSettings?.find((s) => s.isActive);

	// Initialize state from activeSetting when it loads
	// Sync happens regardless of dialog state to prevent race condition
	useEffect(() => {
		// Use server values if available, otherwise use defaults
		setAutoEnabled(activeSetting?.autoFineTuning ?? false);
		setThreshold(activeSetting?.fineTuningThreshold ?? 100);
	}, [activeSetting]);

	// Get auto fine-tuning stats
	const { data: autoStats, isLoading: statsLoading } =
		useQuery<AutoFineTuningStats>({
			queryKey: [`/api/fine-tuning/auto-stats/${projectId}`],
			enabled: !!projectId,
		});

	// Get export stats
	const { data: exportData, isLoading: exportLoading } = useQuery<{
		stats: ExportStats;
	}>({
		queryKey: [`/api/fine-tuning/export/${projectId}`],
		enabled: !!projectId,
	});

	// Get fine-tuning status
	const { data: ftStatus, isLoading: statusLoading } =
		useQuery<FineTuningStatus>({
			queryKey: [`/api/fine-tuning/status/${projectId}`],
			enabled: !!projectId,
			refetchInterval: (query) => {
				const status = query.state.data?.status;
				return status === "running" || status === "pending" ? 10000 : false;
			},
		});

	// Get fine-tuning jobs history
	const { data: jobsData, isLoading: jobsLoading } = useQuery<{
		jobs: FineTuningJob[];
	}>({
		queryKey: [`/api/fine-tuning/jobs/${projectId}`],
		enabled: !!projectId,
	});

	// Start fine-tuning mutation
	const startFineTuningMutation = useMutation<FineTuningMessageResponse>({
		mutationFn: async () => {
